import React from "react"
import MaterialCard from "./MaterialCard.js"
import coffee_img from '../images/coffee_img.png'

function Home(){
    return(
        <div className="materials">
            <h2>Home</h2>
            <MaterialCard 
                material={{imgUrl:{coffee_img},
                sloganText:"Coffee for your spirits"}}
            />
            <MaterialCard 
                material={{imgUrl:{coffee_img},
                sloganText:"Great Coffee"}}
            />
            <MaterialCard 
            material={{imgUrl:{coffee_img},
            sloganText:"Coffee for your spirits"}}
            />
        </div>
    )
}

export default Home
